Firstly let us consider breaking every term separately as follows;  
\begin{align*}    
&   10=2*5\\     
&   15=3*5 \\      
&   24=2^3 *3\\       
\end{align*}     Now multiplying them together yields $$10*15*24=(2*5)*(3*5)*(2^3 *3)$$ After simplifying , it becomes $$10*15*24=2^4 *3^2 *5^2$$ To calculate the squares roots now just put one symbol "$" out side the bracket . It goes like : $$\sqrt {10*15*24}=$$ Substituting back our terms inside brackets according to power rule results as following ; $$(\sqrt {2^4}) (\sqrt {3^2})(\sqrt{5^2})$$ Simplify further by removing symbols "^". Finally yielding the answers as ; $$2*3*5=30$$ Hence Final Answer Is Given As Follows :- $$\boxed{30}$$

